export function Book(props) {

  const id = props.id;

  const bookName = props.bookName;

  const bookType = props.bookType;

  const bookStatus = props.bookStatus;

  const createdAt = props.createAt;

  return (
      <div>
        <div className="col">
          <div className="row text-muted">{id}</div>
          <div className="row">{bookName}</div>
        </div>
        <div className="col text-center price">{bookType}</div>
        <div className="col text-center price">{bookStatus}</div>
        <div className="col text-center price">{createdAt}</div>

      </div>
  )

}
